import React from 'react';

const umpireConfig = {
	ball: {
		text: 'Ball!',
		icon: null
	},
	strike: {
		text: 'Strike!',
		icon: null
	},
	out: {
		text: 'Out!',
		icon: null
	}
};

const DiceRoll = (props) => {
	return (
		<div>
			<div>DiceRoll: {props.diceRoll}</div>
			<div>DiceTotal: {props.diceTotal}</div>
			<div>Balls: </div>
			<div>Strikes: </div>
			<div>Outs: </div>
		</div>
	);
};

export default DiceRoll;
